import React, { useState } from 'react'
import './style.css'
interface IState {
  people: {
    image: string;
    name: string;
    address: string;
    phone: string;
  }[]

}



const App = () => {
  const [people, setPeople] = useState<IState["people"]>([
    {
      image: "",
      name: "",
      address: "",
      phone: ""
    }
  ])
  return (
    <div className='App'>
      <div className="container" >
        <div className="row my-3">
          <div className="col-12 header text-primary">
            <h5 className='text-center'> Frie's Phone Book</h5>
          </div>
        </div>
        {
          people.map((user) => {
            return (
              <div className="row  my-2  resultBox">
                <div className="col-md-2"><img src={user.image} alt="user.index" /> </div>
                <div className="col-md-3 text-center"> {user.name} </div>
                <div className="col-md-3 text-center">{user.address}</div>
                <div className="col-md-4 text-center">{user.phone}</div>
              </div>
            )
          })
        }

      </div>
    </div>
  )
}

export default App
